const api = axiost.create({

    baseURL:`https://pokeapi.co/api/v2`


})

async function getPokemon(id) {
    try {
      const response = await axios.get(`/pokemon/${id}`);
      console.log(response);
    } catch (error) {
      console.error(error);
    }
  }

export {getPokemon}
